CREATE TABLE `markers` (
  `id` varchar(36) COLLATE utf8_unicode_ci NOT NULL,
  `gov_id` int(11) NOT NULL DEFAULT '0',
  `user_id` varchar(36) COLLATE utf8_unicode_ci NOT NULL,
  `status_id` int(11) NOT NULL DEFAULT '0',
  `district_id` int(11) DEFAULT NULL,
  `source_id` varchar(36) COLLATE utf8_unicode_ci NOT NULL,
  `subject` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `description` text COLLATE utf8_unicode_ci NOT NULL,
  `category_id` int(11) NOT NULL DEFAULT '0',
  `street` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `zip` varchar(6) COLLATE utf8_unicode_ci NOT NULL,
  `city` varchar(128) COLLATE utf8_unicode_ci NOT NULL,
  `address_id` int(10) DEFAULT NULL,
  `lat` float(10,6) NOT NULL DEFAULT '0.000000',
  `lon` float(10,6) NOT NULL DEFAULT '0.000000',
  `created` datetime DEFAULT NULL,
  `modified` datetime DEFAULT NULL,
  `rating` float(3,1) DEFAULT '0.0',
  `votes` int(11) DEFAULT '1',
  `voting_pro` int(11) DEFAULT '0',
  `voting_con` int(11) DEFAULT '0',
  `voting_abs` int(11) DEFAULT '0',
  `feedback` int(4) NOT NULL,
  `media_url` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `event_start` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL,
  `event_end` varchar(11) COLLATE utf8_unicode_ci DEFAULT NULL,
  `spots` int(11) DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `ind_unico` (`street`,`zip`,`city`),
  KEY `processcat_id` (`status_id`)
) ENGINE=MyISAM DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;
